import { useState } from "react"
export default function useMyHook() {
    const [coord, setCoord] = useState({x: NaN, y: NaN})
  
    function tracking(x: number, y:number) {
      setCoord({x, y})
    }
    let inBound = !isNaN(coord.x) && !isNaN(coord.y)
    let color: string;

if(inBound) {
    if(coord.x + coord.y > 650) {
        color = 'blue'
    } else {
        color = 'red'
    }
} else {
    color = 'yellow'
}

return {
    x:coord.x,
    y:coord.y,
    tracking,
    color,
}
}
